create table ISSUES
(
    ID              NUMBER(19) generated as identity
        primary key,
    ASSIGNED_DATE   TIMESTAMP(6),
    CREATION_DATE   TIMESTAMP(6),
    DESCRIPTION     VARCHAR2(255 char),
    MEMO            VARCHAR2(255 char),
    MODIF_DATE      TIMESTAMP(6),
    PRIORITY        VARCHAR2(255 char),
    PROBLEM_ID      NUMBER(10),
    SOLUTION        VARCHAR2(255 char),
    ASSIGNED_ID     NUMBER(19),
    ISSUE_TYPE_ID   NUMBER(19),
    POS_ID          NUMBER(19),
    STATUS_ID       NUMBER(19),
    USER_CREATED_ID NUMBER(19)
)
/

